import "../../styles/AvailableProducts.css"
import Product from "./Product";

const AvailableProducts = (props) => {
    const product = {
        key: Math.random(),
        id: Math.random(),
        name: 'nommbre',
        price: 9.99
    }
    return (
        <section className="feapi-section">
            <ul className="feapi-list">
                <Product key={product.id} id={product.id} name={product.name} price={product.name} />
                <Product name='nombre' price={9.99999} />
                <Product name='nombre' price={9.99999} />
                <Product name='nombre' price={9.99999} />
            </ul>
        </section>
    )
}

export default AvailableProducts;
